import { Component } from '@angular/core';
import { FormGroup } from '@angular/forms';
import { UserService } from 'src/app/services/user.service';
import { User } from 'src/app/shared/models/User';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent  {

  user!:User
  constructor(private userService:UserService,){


  }


  submitForm(){

this.userService.signupUser(this.user).subscribe({
next:(data)=>{
  alert("sign up success!!")
  console.log(data)
},
error:(error)=>{
  alert("error occured");
  console.log(error)

},

complete:()=> {
    console.log('completed')
},


})

  }

}

<div class="container py-3">

    <div class="row">

        <div class="col-md-6 offset-3 py-3">
          <div class="card bg-dark text-white">
            <div class="card-title text-center py-2 bg-success"><h3>Login Form</h3></div>
            <div class="card-body p-5">
                <form  (ngSubmit)="submitForm()">


                  <div class="mb-2">
                    <label for="exampleInputPassword1" class="form-label">Username</label>
                    <input  name="name" [(ngModel)]="user.name"  type="text" class="form-control" id="exampleInputPassword1" formControlName="password">
                  </div>

                    <div class="mb-2">
                      <label for="exampleInputEmail1" class="form-label">Email address</label>
                      <input name="email" [(ngModel)]="user.email" type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"
                        >

                    </div>
                    <div class="mb-2">
                      <label for="exampleInputPassword1" class="form-label">Password</label>
                      <input  name="password" [(ngModel)]="user.password"  type="password" class="form-control" id="exampleInputPassword1" formControlName="password">
                    </div>

                <div class="mb-2">
                  <label for="exampleInputPassword1" class="form-label">Address</label>
                  <textarea  name="address" [(ngModel)]="user.address"   class="form-control" id="exampleInputPassword1" formControlName="password">
                  </textarea>
                  </div>


                  <div class="text-center py-2">
                    <button type="submit" class="btn  btn-success" >Signup</button>
                </div> 
                </form>

            </div>


          </div>


        </div>
    </div>
</div>
